import React from 'react'

export default function Privacy() {
  return (
    <>
    <div className="heading">Privacy Policy</div>
    <p>The goal of Instacash is to give you the best services while upholding your right to privacy. We want to make sure that all of our clients' information is kept private. We establish a solid foundation of customer trust in this way.
    By signing up with Instacash, you will get phone, email, and SMS messages from our company. Here are some specifics on the personal data we need; however, we do not save any client data.
    </p>
    </>
  )
}
